import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => 
{
    return(
        <nav>
            <ul>
                <li>
                    <NavLink to="/login">Login</NavLink>
                </li>
                <li>
                    <NavLink to="/home">Home</NavLink>
                </li>
                <li>
                    <NavLink to="/">Transaction</NavLink>
                </li>
                <li>
                    <NavLink to="/">History</NavLink>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
